import { useEffect, useState } from 'react'
const Rfp = () => {
    const [data, setData] = useState(null)

    useEffect(() => {
        const getData = async () => {
            setData(await get_sentences_rfp())
        }
    }, [])
  return (
      <div>
          {data ? data : 'No data'}

    </div>
  )
}

export default Rfp
